import React, { useState } from "react";
import DivforButton from "./Button/DivforButton";
import Button from "./Button/button";
// import { Redirect } from "react-router-dom";

function logOut() {
  function logout(e) {
    e.preventDefault();
    fetch("http://localhost:3000/login", {
      method: "POST",
      credentials: "include",
      withCredentials: true,
      headers: {
        "Content-Type": "application/json",
      },

      body: JSON.stringify(login),
    })
      .then(function (response) {
        console.log(response); // Will show you the status
        if (!response.ok) {
          changeLogin({ email: "", password: "" });
          throw new Error("HTTP status " + response.status);
        }
        return history.push("/");
      })
      .catch((err) => console.log(err));
  }
  fetch("http://localhost:3000/", {
    method: "Post",
    credentials: "include",
    withCredentials: true,

    headers: {
      "Content-Type": "application/json",
    },
  })
    .then((res) => res.json())

    .then((data) => changeName(data.firstName))
    .catch((err) => console.log(err));
  return (
    <div>
      <h1>Click to Logout </h1>
      <DivforButton
        button={
          <React.Fragment>
            <Button text="TESTLogout" link="/" type="Submit" onClick={logout} />
            <Button text="Register" link="/register" />
            <Button text="Home" link="/" />
            <Button text="Login" link="/login" />
            <Button text="Profile" link="/user" />
          </React.Fragment>
        }
      />
    </div>
  );
}

export default logOut;
